import React from "react";
import './index.css';
import returnicon from '../wishlist/images/backicon.png';
import football from '../wishlist/images/football.png';
import string from '../wishlist/images/string.png';
import racket from '../wishlist/images/racket.png';


let CartProductData = [
    {
        image: football,
        title: 'Football',
        buy: 'Rent ₹120',
    },
    {
        image : string,
        title :'Gym home workout',
        buy: 'Rent ₹1200',
    },
    {
        image : racket,
        title :'Gym home workout',
        buy: 'Rent ₹1200',
    }
]

function WishList() {
    return (
        <>
        <div className="cart-header-container">
            <div className="cart-header-icon">
                <img src={returnicon} alt='' />
            </div>
            <div className="cart-header-title">Wishlist</div>    
        </div>
        <div className="cart-select-item-container">
            {CartProductData.map((d, i) => (
                <div className="cart-select-item-block">
                    <div className="cart-select-item-image">
                        <img src={d.image} alt="" width={60} height={60} />
                    </div>
                    <div className="cart-select-items">
                        <div className="cart-select-item-title">{d.title}</div>
                        <div className="cart-select-item-price">{d.buy}</div>
                    </div>
                </div>
            ))}
        </div>
        </>
    );
}

export default WishList;
